  },

  {
    name: 'SouaChaap',
    image: 'https://th.bing.com/th?id=OIP.8-Wb04aFOlueUyDUtgXFuQHaFj&w=288&h=216&c=8&rs=1&qlt=90&o=6&dpr=1.3&pid=3.1&rm=2', // Replace with actual image URL
